	('95ee5d79-931d-42b6-a126-9cc6751fdd72', 'd6pwm23d7qj6', NULL, NULL, 'ITO-2024-I-00013', 'Kitaro Nishida "Yuen"', '西田幾多郎 悠遠', 'public', '2025-08-18 08:40:20.912111+00', '2025-08-18 08:40:20.912111+00', 650000.00, '{掛軸}', 'Kitaro Nishida', NULL, 'Azabudai', 'yuuen', 'Matsumoto Shoeido', NULL, '西田幾多郎', '麻布台', NULL, '松本松栄堂', 'fbf14613-7a5d-465f-9d4c-b52283729959'),
	('349769c6-5627-488f-af82-62f8cfa156ca', 'q5kn2pq2262n', NULL, NULL, 'ITO-2024-I-00019', 'Tomoko Tsuda Water Vessel', '津田友子　水指 雨滴聲 金彩「桃源郷」', 'public', '2025-09-06 22:44:39.525149+00', '2025-09-06 22:44:39.525149+00', 900000.00, '{水指}', 'TSUDA Tomoko', NULL, 'Tsudanuma', NULL, 'Hakuhakuan', 'https://pakupakuan.shop/products/%E6%9C%9F%E9%96%93%E9%99%90%E5%AE%9A-%E7%82%8E%E4%B8%89%E6%85%8B-%E6%B4%A5%E7%94%B0%E5%8F%8B%E5%AD%90-%E6%B0%B4%E6%8C%87-%E9%9B%A8%E6%BB%B4%E8%81%B2-%E9%87%91%E5%BD%A9-%E6%A1%83%E6%BA%90%E9%83%B7-g-61-tsdyti001?_pos=28&_sid=7931c4270&_ss=r', '津田友子 / TSUDA Tomoko', '津田沼', NULL, '白白庵', '05e69051-7d66-4447-bbe1-ed80cb3017e2'),
	('0e3a7025-e139-4ad5-9691-d58c51582bf8', 'r2hmngtwtfn4', NULL, NULL, 'ITO-2023-I-00002', 'Kurasaki Gombei Izumoyaki Bowl', '出雲焼 権兵衛作 黄伊羅保写', 'public', '2025-09-06 22:44:48.831416+00', '2025-09-06 22:44:48.831416+00', NULL, '{茶碗}', NULL, NULL, 'Azabudai', '350 years old

Kurasaki Gonbei

Izumo Ware
Since the time of Matsudaira Naomasa, the first head of the Matsue clan, Izumo had a kiln in Tsuyama Rakuzan, Yatsuka County (present-day Matsue City), but it was not doing very well. Therefore, Tsunari II, the second head of the clan, sought a skilled craftsman as his successor. After various negotiations with the neighboring Mori clan, he finally succeeded in welcoming Kurasaki Gonbei to the Rakuzan kiln by granting him preferential treatment as a samurai.
Gonbei worked at the Rakuzan kiln for around 18 years, starting in 1673 (the first year of the Enpo era), and became its first master. However, due to his exceptional skill, he is more famous as a person and a family than as the first master of Rakuzan ware.
He was a conscientious artist, said to have even smashed up to 90% of a tea bowl he made if he was not satisfied with it, and very few of his authentic works have been handed down through the generations.
He specialized in Irabo copying, and although his works are unsigned, his individuality shines through in the clarity of the imported tsumugi silk, the dyeing of the bamboo joint stand, and the way the wakidori is carved. He is said to have died around the age of 60 in 1694 (Genroku 7).

Izumo Pottery
Izumo had a pottery kiln in Tsuyama Rakuyama, Yatsuka County (now Matsue City) since the time of Matsudaira Naomasa, the first Matsue governor, but it was not doing well. Tsunariku II sought a good craftsman, and after various negotiations with the Mori family in the neighboring country, he finally succeeded in having Kuranoteki Gonbei treated as a samurai and welcomed him to the Rakuzan kiln.
Gonpei worked at the Rakuzan kiln for 18 years from 1673 and became the first generation of Rakuzan Pottery, but because of his extraordinary skills, he was more famous as an individual than as the first generation of Rakuzan Pottery.
He was a conscientious artist who is said to have smashed even the ninth part of a hundred tea bowls if he did not like them.
He specialized in copying Iraho, and although his works are unmarked, his individuality can be seen in the brilliance of the silk pongee, the dye-refined finish of the bamboo joints on the stand, and the way he shaved the sides of the bowl. He is said to have died around the age of 60 in the seventh year of the Genroku era (1694).', 'Seishodo Yamashita', NULL, '倉崎権兵衛 くらさきごんべえ', '麻布台', '350 years old

倉崎権兵衛 くらさきごんべえ

出雲焼
出雲には松江陥の初代松平直政の時代から八束郡津山楽山（現松江市）に阪器窯があったがいっこうに振るわない。しそこで二代目綱陸が振典さすぺく良工を求めた結果、隣国の毛利家といろいろ交渉のすえ、倉的権兵街を士分扱いに優遇してようやく楽山窯に迎えることに成功した。
権兵衛は延宝元年（一六七三）から前後十八年間、楽山窯に従事して、その初代となったが、権兵衛の技量が非凡であったため楽山焼初代というよりも、椛兵衛個，人としてのほうが名が高く一家をなしている。
彼は茶碗百個を作っても気に入らなければ九分までも叩き割ったとさえいわれる良心的作家であったから、その真作の伝世するものはいたって少ない。
伊羅保写を得意とし、作品は無銘であるが、輸紬の冴え、竹節店台の染壮、脇取の削り方など、どこかに個性がにじみ出ている。元禄七年（一六九四）ごろ、六十歳前後で没したといわれる。

Izumo Pottery
Izumo had a pottery kiln in Tsuyama Rakuyama, Yatsuka County (now Matsue City) since the time of Matsudaira Naomasa, the first Matsue governor, but it was not doing well. Tsunariku II sought a good craftsman, and after various negotiations with the Mori family in the neighboring country, he finally succeeded in having Kuranoteki Gonbei treated as a samurai and welcomed him to the Rakuzan kiln.
Gonpei worked at the Rakuzan kiln for 18 years from 1673 and became the first generation of Rakuzan Pottery, but because of his extraordinary skills, he was more famous as an individual than as the first generation of Rakuzan Pottery.
He was a conscientious artist who is said to have smashed even the ninth part of a hundred tea bowls if he did not like them.
He specialized in copying Iraho, and although his works are unmarked, his individuality can be seen in the brilliance of the silk pongee, the dye-refined finish of the bamboo joints on the stand, and the way he shaved the sides of the bowl. He is said to have died around the age of 60 in the seventh year of the Genroku era (1694).', '清昌堂やました', 'c074c1a2-3397-473d-a900-a6a17c1ead7d'),
