	('3a8edc79-9027-4e8e-90e1-d4aecea1d05a', 'k9h3s6btzh0q', NULL, NULL, 'ITO-2024-I-00016', 'ITO-2024-I-00016', '江月宗玩「斗指両辰間」', 'public', '2025-08-18 08:40:29.302226+00', '2025-08-18 08:40:29.302226+00', 2200000.00, '{掛軸}', NULL, NULL, NULL, 'Tosa Ryōshin no Kan
Kōgetsu Sōgan (November 8, 1574 (November 21, 1574) – August 19, 1643 (October 1, 1643)) was a Rinzai sect monk from the Azuchi-Momoyama period to the early Edo period. He was the abbot of Daitoku-ji Temple. He was the son of Tsuda Sōeki, a wealthy merchant in Sakai who served as a tea master under Oda Nobunaga and Toyotomi Hideyoshi. His older brother was Tsuda Sōbon, who inherited the Tennojiya. His secular name was Sōmaru. His childhood name was Michimaru, then Shunshō. His pen names included Ketsushinshi, Ebukuroshi, and Kakkakushi. His posthumous name was Dairyō Kōshō Zen Master.', NULL, NULL, '江月宗玩 こうげつ そうがん', '津田沼', 'とさりょうしんのかん
江月 宗玩（こうげつ そうがん、天正2年11月8日（1574年11月21日） - 寛永20年8月19日（1643年10月1日））は、安土桃山時代から江戸時代前期にかけての臨済宗の僧。大徳寺住持。堺の豪商で織田信長、豊臣秀吉に茶頭として仕えた津田宗及の子。天王寺屋を継いだ津田宗凡は兄。俗名は宗丸。幼名を道丸、次いで春松。号に欠伸子、慒袋子、赫々子など。諡は大梁興宗禅師。', '戸田商店', 'fbf14613-7a5d-465f-9d4c-b52283729959');


